import { useParams } from "react-router-dom"
import Header from "./Header";


const ProviderDetail = () => {

    const { name } = useParams();


    const providers = [
        {
            name: "Netflix",
            src: netflix,
            color: "red"
        },
        {
            name: "Amazon Prime",
            src: prime,
            color: "blue"
        },
        {
            name: "HBOMax",
            src: hbo,
            color: "purple"
        },
        {
            name: "Hulu",
            src: hulu,
            color: "cyan"
        },
        {
            name: "Disney Plus",
            src: disney,
            color: "black"
        },
        {
            name: "DAZN",
            src: dazn,
            color: "blue"
        },
    
    ]

    return(
        <>
            <Header></Header>

            <section>
                <img></img>
            </section>
            <h1>{name}</h1>
        </>
    )
}

export default ProviderDetail
